const Search = () => {
    return (
        <form className="form-inline">
        <input style={{height:"40px"}} className="form-control p-1 rounded-pill border border-dark mr-4 w-50" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn btn-outline-success btn-sm rounded " type="submit">Search</button>
      </form>
      );
}
 
export default Search;
